生存性 (liveness) は、この章の次の節で詳しく説明する ライフタイム (lifetime) とは違うことに注意してください。 大雑把に言うと、参照を参照外しできるとき、 その参照は、プログラム中のある時点で 生存している といえます。 共有参照は、文字通り到達不可能な場合（たとえば、解放済みメモリやリークしてるメモリに 存在している場合）を除いて、常に生存しています。 可変参照には、 又貸し というプロセスがあるので、到達できても生存して いない ことがあります。 可変参照は、その子孫を他の共有参照または可変参照に又貸しすることができます。 又貸しした参照は、派生したすべての又貸しの有効期限が切れると、再び生存することになります。 例えば、可変参照は、その参照先の一つのフィールドを指す参照を又貸しすることができます。 let x = &mut (1, 2);
{ // x のフィールドを又借りする let y = &mut x.0; // この時点で y は生存しているが、x は生存していない *y = 3;
}
// y がスコープ外に出たので、x が再び生存中になる
*x = (5, 7); 複数の 可変参照に又貸しすることも可能ですが、その複数の参照は互いに素でなくてはいけません。 つまり、どの参照も他の参照の先祖であってはいけないということです。 Rust は、構造体のフィールドが互いに素であることを静的に証明できるので、 フィールドの又貸しが可能です。 let x = &mut (1, 2);
{ // x を 2 つの互いに素なフィールドに又貸しする let y = &mut x.0; let z = &mut x.1; // y と z は生存しているが、x は生存していない *y = 3; *z = 4;
}
// y と z がスコープ外に出たので、x がふたたび生存中になる
*x = (5, 7); ただし、多くの場合 Rust は十分に賢くないので、複数の借り手が互いに素であることを証明できません。 これはそのような又貸しが禁じられているという意味ではなく 、 単に Rust が期待するほど賢くないというだけです。 話を単純にするために、変数を参照型の一種、 所有中 参照、と仮定してみましょう。 所有中参照は、可変参照とほとんど同じ意味を持ちます。 可変参照または共有参照に又貸しでき、それによって生存中ではなくなります。 生存中の所有中参照は、値を解放（ムーブアウト）できるという特殊な性質があります （とはいえ、可変参照は値をスワップアウトできますが）。 この能力は、 生存中の 所有中参照のみに与えられています。 そうでなければ、早すぎるタイミングでその他の参照を無効にすることになります。 不適切な値の変更を lint が検出するので、mut とマークされた変数だけが変更可能なように借用されます。 Box がまさに所有中参照のように振る舞うということを覚えておくと良いでしょう。 Box は値を解放することができ、変数が解放された時と同様に Rust はそのパスについて推論するための 十分な情報を持っています。

20.body:
Rust は今まで説明してきたルールを ライフタイム を使って強制します。 ライフタイムとは、要するにプログラム中のスコープの名前です。 参照と、参照を含むものとは、有効なスコープを示すライフタイムでタグ付けられています。 通常、関数本体では、関係するライフタイムの名前を明示することは求められません。 一般に、ローカルコンテキストにおいてライフタイムを気にする必要はまずないからです。 Rust はすべての情報を持っていて、可能な限りすべてを最適にできます。 省略可能な無名スコープや一時変数は、コードがきちんと動くように自動的に導入されます。 しかし関数の境界を超えると、ライフタイムについて気にしなくてはいけなくなります。 ライフタイムは、'a や 'static などアポストロフィーつきの名前を持ちます。 ライフタイムの世界に足を踏み入れるために、 スコープにライフタイムのラベルをつけられるとして、この章の最初のサンプルコードを 「脱糖 (desugar)」してみましょう。 もともとのサンプルコードは、スコープとライフタイムについて、 果糖がたくさん含まれたコーンシロップのように 強烈に 甘い書き方でした。 （訳注：ライフタイムを省略できることは syntax sugar で、元のコードは大量の syntax sugar を使っているので、「甘い」と言っている） なぜなら、すべてを明示的に書くのは 極めて煩わしい からです。 Rust のコードは、積極的な推論と「明らかな」ことの省略とを当てにしています。 let 文が、スコープを暗黙的に導入するというのは、興味深いシンタックスシュガーでしょう。 ほとんどの場合、これは問題になりません。 しかし、複数の変数がお互いを参照している場合は問題になります。 簡単な例として、この単純な Rust コードを脱糖してみましょう。 let x = 0;
let y = &x;
let z = &y; 借用チェッカは、ライフタイムの長さを最小にしようとするので、 これは次のように脱糖されるでしょう。 // `'a: {` と `&'b x` は正当な構文ではないことに注意してください!
'a: { let x: i32 = 0; 'b: { // ここで使用されるライフタイムは 'b です。なぜなら 'b で十分だからです。 let y: &'b i32 = &'b x; 'c: { // 'c も同様 let z: &'c &'b i32 = &'c y; } }
} おっと。こんなふうに書かなければいけないとしたら・・・これはひどいですね。 ここでしばらく時間をとって、簡単な構文を許してくれる Rust に感謝を意を表しましょう。 参照を外のスコープに返す場合は、Rust はより大きいライフタイムを推論することになります。 let x = 0;
let z;
let y = &x;
z = y; 'a: { let x: i32 = 0; 'b: { let z: &'b i32; 'c: { // ここでは 'b を使う必要があります。なぜならこの参照は // スコープ `b に渡されるからです。 let y: &'b i32 = &'b x; z = y; } }
}

