それでは、以前に出した例を見てみましょう。 fn as_str(data: &u32) -> &str { let s = format!("{}", data); &s
} は次のように脱糖されます。 fn as_str<'a>(data: &'a u32) -> &'a str { 'b: { let s = format!("{}", data); return &'a s; }
} as_str のシグネチャは、 ある ライフタイムを持つ u32 への参照をとり、 その参照と 同じ長さだけ 生きる str への参照を生成することを約束します。 このシグネチャが問題になるかもしれないと、すでに話しました。 このシグネチャは、引数の u32 を指す参照が生成されたスコープか、もしくは それより以前のスコープ で、str を探すことを意味します。これはなかなか難しい注文です。 それから文字列 s を計算し、その参照を返します。 この関数は、返される参照が 'a より長生きすることを約束しているので、この参照のライフタイムとして 'a を使うことを推論します。 残念なことに、s はスコープ 'b の中で定義されているので、 この推論が妥当になるためには、'b が 'a を含んでいなくてはなりません。 ところがこれは明らかに成立しません。'a はこの関数呼び出しそものを含んでいるからです。 結局、この関数は参照先より長生きする参照を生成してしまいました。 そしてこれは 文字通り 、参照がやってはいけないことの一番目でした。 コンパイラは正当に怒りだします。 よりわかりやすくするために、この例を拡張してみます。 fn as_str<'a>(data: &'a u32) -> &'a str { 'b: { let s = format!("{}", data); return &'a s }
} fn main() { 'c: { let x: u32 = 0; 'd: { // この x の借用は、x が有効な全期間より短くて良いので、無名スコープが導入されます。 // as_str は、この呼び出しより前のどこかにある str を見つけなければいけませんが、 // そのような str が無いのはあきらかです。 println!("{}", as_str::<'d>(&'d x)); } }
} ちくしょう！ この関数を正しく書くと、当然次のようになります。 fn to_string(data: &u32) -> String { format!("{}", data)
} この関数が所有する値を関数内で生成し、それを返さなくてはいけません！ str が &'a u32 のフィールドだとしたら、&'a str を返せるのですが、 もちろんそれはありえません。 （そういえば、単に文字列リテラルを返すこともできたかもしれません。 文字列リテラルはグローバルで、スタックの底に存在すると解釈できますから。 ただこれはこの関数の実装を ほんの少しだけ 制限してしまいますね。）

