もう一つの例はどうでしょう。 let mut data = vec![1, 2, 3];
let x = &data[0];
data.push(4);
println!("{}", x); 'a: { let mut data: Vec<i32> = vec![1, 2, 3]; 'b: { // スコープ 'b は次の貸し出しに必要なだけ大きくなります。 // （`println!` を含むまで大きくなります） let x: &'b i32 = Index::index::<'b>(&'b data, 0); 'c: { // &mut は長生きする必要が無いので、一時的なスコープ 'c が作られます。 Vec::push(&'c mut data, 4); } println!("{}", x); }
} これは、すこし分かりにくいですが面白い問題です。 私たちは、Rust が次のような理由で、このプログラムを拒否するだろうと思っています。 つまり、push するために data への可変参照を取ろうとするとき、 data の子孫への共有参照 x が生存中です。 これは可変参照の別名となり、参照の 二番目 のルールに違反します。 ところが、Rust がこのプログラムを悪いと推論するやり方は 全く違う のです。 Rust は、x が data の部分パスへの参照であることは理解しません。 Rust は Vec のことなど何も知らないのです。 Rust に 見えている のは、x は println! のためにスコープ 'b の中で生存しなくてはならないことです。 さらに、Index::index のシグネチャは、data を参照する参照が スコープ 'b の中で生存することを要求します。 push を呼び出すときに、&'c mut data を取ろうとすることを Rust は理解します。 Rust はスコープ 'c が スコープ 'b に含まれていることを知っているので、 このプログラムを拒否します。 なぜなら、&'b data はまだ生きているからです。 ここでは、ライフタイムをチェックするシステムは、私たちが維持したい参照の意味論に比べて とても荒いことを見てきました。 ほとんどの場合、 これで全く大丈夫 です。 私たちが書いたコードをコンパイラに説明するために丸一日費やさなくてもいいからです。 しかし、ライフタイムのチェックがとてもバカなために、Rust の 真の 意味論的には全く正しいプログラムでも拒否されることがあるのです。

