Rust ではなんと、スペースを持たない型を使うことができます。 struct Foo; // フィールドがない = サイズ 0 // すべてのフィールドのサイズがない = サイズ 0
struct Baz { foo: Foo, qux: (), // 空のタプルにはサイズがありません baz: [u8; 0], // 空の配列にはサイズがありません
} サイズ 0 の型（ZST）は、当然ながら、それ自体ではほとんど価値がありません。 しかし、多くの興味深いレイアウトの選択肢と組み合わせると、ZST が潜在的に役に立つことがいろいろな ケースで明らかになります。Rust は、ZST を生成したり保存したりするオペレーションが no-op に 還元できることを理解しています。 そもそも、ZST はスペースを要求しないので、保存することには意味がありません。 また ZST は 1 つの値しかとらないので、ZST を読み込む操作は、 代わりに無から ZST を作り出すことができ、この操作もスペースを必要としないので no-op と同じです。 究極の ZST の利用法として、Set と Map を考えてみましょう。 Map<Key, Value> があるときに、Set<Key> を Map<Key, UselessJunk> の 簡単なラッパとして実装することはよくあります。 多くの言語では、UselessJunk のスペースを割り当てる必要があるでしょうし、 結果的に使わない UselessJunk を保存したり読み込んだりする必要もあるでしょう。 こういったことが不要であると示すのはコンパイラにとっては難しい仕事でしょう。 しかし Rust では、単に Set<Key> = Map<Key, ()> と言えばいいだけなのです。 Rust は静的な解析で、読み込みや保存が無意味であること、メモリ割当が必要ないことを理解します。 結果として単態化したコードは、HashSet のためにカスタマイズされ、 HashMap を使う場合のオーバーヘッドはなくなります。 安全なコードは ZST について心配する必要はありませんが、 アンセーフな コードは サイズ 0 の型を使った時の結果について注意しなくてはなりません。 特に、ポインタのオフセットは no-op になることや、 （Rust のデフォルトである jemalloc を含む）標準的なメモリアロケータは、 サイズ 0 の割り当て要求には nullptr を返すこと （これはメモリ不足と区別がつきません）に注意してください。
